import React, { FC } from 'react';
import Layout from '../components/Layout';

const Home: FC = () => {
  return (
    <>
      <Layout>
        <h1>Ricardo Rodrigues</h1>
        Hello World
      </Layout>
    </>
  );
};

export default Home;
